import React from 'react';

export default function About(){
  return (
    <div className="container container-smash mt-5">
      <div className="glass p-5 fade-in show text-center">
        <h2>About Us</h2>
        <p className="text-muted">
          Welcome to <strong>Online Job Portal</strong> — developed as a college project inspired by Apple’s Liquid Glass UI design.
          We aim to make job searching intuitive and visually elegant.
        </p>
        <div className="row mt-4 justify-content-center">
          <div className="col-md-3 mb-3"><div className="glass p-3"><h5>Ayush Ranjan</h5><p>PRN: 250840320040</p></div></div>
          <div className="col-md-3 mb-3"><div className="glass p-3"><h5>Vibhav Chavan</h5><p>PRN: 250840320232</p></div></div>
          <div className="col-md-3 mb-3"><div className="glass p-3"><h5>Deepra Banerjee</h5><p>PRN: 250840320052</p></div></div>
        </div>
        <p className="mt-4 text-muted">Guided by our passion for design, we combined technology and creativity to build this responsive full-stack web portal.</p>
      </div>
    </div>
  );
}
